import React, { useState } from 'react'
import { Card } from 'semantic-ui-react'

const src = './media/profile_pictures/default.jpg'

const profileImages = ['default', 'christian', 'daniel', 'elliot', 'jenny', 'joe', 'steve', 'stevie']

const ProfileImage = () => {
    return (
        <div>
            <Card.Group itemsPerRow={10}>
                {profileImages.map(image => {
                    return <Card raised image={require(`./media/profile_pictures/large/${image}.jpg`)} />

                })}
            </Card.Group>
        </div>
    )
}

export default ProfileImage
